import React from 'react'

import BaseLayout from './../components/layouts/BaseLayout'
import { Container } from 'reactstrap'

class Index extends React.Component {
  render () {
    return (
      <BaseLayout>
        <Container />
      </BaseLayout>

    )
  }
}
export default Index
